INSERT INTO product (barcode_id, product_name, ingredients, product_image, fat_amount, saturated_fats, carbohydrate, sugar, dietary_fiber, protein, salt, sodium, alcohol, is_healthy)
VALUES ('5060229013835', 'pukka trois tulsi', 'The herb that shows you the way India calls her Holy Basil\'. Here, tulsi is legendary. Green tulsi for sweeping away the clutter, purple tulsi for uplifting spirits, and lemon tulsi with a zesty twist. To inner clarity. Visit pukkaherbs.com sefatia PS Master Herbsmith Bring these incredible herbs alive by infusing in freshly boiled water for up to 15 minutes. La plante qui vous montre la voie En Inde on l\'appelle « basilic sacré ». Ici, tulsi est légendaire. Le tulsi vert pour mettre fin à la confusion, ensuite du tulsi violet pour apporter de la bonne humeur, et du tulsi citronné avec une note légèrement acidulée. Pour la lucidité intérieure. Donnez vie aux incroyables herbes en les laissant infuser dans l\'eau fraichement bouillie jusqu\'à 15 minutes. Naturally caffeine -free and ethically sourced, 100% organically grown ingredients: Green Rama tulsi leaf (45%), purple Krishna tulsi leaf (45%), lemon Vana tulsi leaf (10%). 100% fair trade ingredients certified by IMO according to the Fair for Life Programme tulsi. FR: Naturellement sans caféine et de source éthique. 100% des ingrédients sont issus de l\'agriculture biologique: Feuille de tulsi vert Rama (45%), feuille de tulsi pourpre Krishna (45%), feuille de tulsi citron Vana (10%). NL: Bereiding: Breng deze bijzondere kruiden tot leven door ze tot 15 minuten in vers gekookt water te laten trekken. Van Krishna paars tulsi blad (45%), Vana citroen tulsi blad (10%). limón (10%). nature cafeinevrij en ethisch verantwoord verkregen. 100% biologisch geteelde ingrediënten: Rama groen tulsi blad (45%), ES: Sin teina. 100% ingredientes ecológicos: Hojas tulsi Rama verde (45%), hojas tulsi Krishna morada (45%), hojas tulsi Vana IT: Miscela biologica per infuso. Ingredienti naturalmente senza caffeina, 100% biologici e selezionati in modo etico: Rama tulsi verde foglie (45%), Krishna tulsi viola foglie (45%), Vana tulsi limone foglie (10%). Best before end: see base/ A consommer de préférence avant fin: voir en bas/Ten minste houdbaar tot einde: zie onderzijde/ Consumir preferentemente antes del fin de: ver base/ Da consumarsi preferibilmente entro fine: vedere il fondo della confezione. BIOLOGY faír for life CERTI AB AGRICULTURE BIOLOGIQUE FOR THE PLANET fair trade GB-ORG-05 CA', 'https://static.openfoodfacts.org/images/products/506/022/901/3835/front_fr.4.400.jpg', '0', '0', '0', '0', '0', '', '', '', '', '1');

